    def tripod_ref(name="Tripod_ISO",surfaceColor=[1.0,0.0,0.0]):
        if inverse: goalNode = (Inverse(scene,rotation,translation),use_orientation)
        else: goalNode = None
        
        poissonRatio=[0.45]*nbr_tretra
        youngModulus=[1200]*nbr_tretra
        
        tripod = Tripod(scene.Modelling,name=name,ho=False,direct=direct,inverse=goalNode,
                        volumeMeshFileName=volumeMeshFileName,
                        translation=translation, rotation=rotation,
                        youngModulus=youngModulus[0], poissonRatio=poissonRatio[0], totalMass=totalMass) #,surfaceColor=surfaceColor,surfaceMeshFileName=surfaceMeshFileName)

        # scene.Simulation.addChild(tripod.ElasticBody.ElasticMaterialObject)
        scene.Simulation.addChild(tripod.ActuatedArm0)
        scene.Simulation.addChild(tripod.ActuatedArm1)
        scene.Simulation.addChild(tripod.ActuatedArm2)
        # scene.Simulation.addChild(tripod.RigidifiedStructure.DeformableParts)
        scene.Simulation.addChild(tripod.RigidifiedStructure)

        if direct: 
            scene.Simulation.createObject('MechanicalMatrixMapper',name='MMM_'+tripod.name,
                                template='Vec3,Rigid3',
                                object1=tripod.RigidifiedStructure.DeformableParts.getLinkPath(),
                                object2=tripod.RigidifiedStructure.RigidParts.dofs.getLinkPath(),
                                nodeToParse = tripod.ElasticBody.ElasticMaterialObject.getLinkPath())


        optitrack = None
        if control_real:
            serial = SerialPortBridgeGeneric(scene)

            # The real robot receives data from the 3 actuators
            serialportctrl = SerialPortController(scene, tripod.actuatedarms, serial,optitrack,tripod.RigidifiedStructure.RigidParts.dofs)
            
            TripodControllerWithCom(scene, tripod,[tripod.ActuatedArm0, tripod.ActuatedArm1, tripod.ActuatedArm2], serialportctrl)

        else:
            # The simulation's control with keystrokes is still available
            TripodController(scene, tripod,[tripod.ActuatedArm0, tripod.ActuatedArm1, tripod.ActuatedArm2])

        if inverse:
            # You can add a GoalController and play with it
            #GoalController(goalNode[0],[tripod.RigidifiedStructure.RigidParts.actuators,tripod.ActuatedArm0.ServoArm.actuator, tripod.ActuatedArm1.ServoArm.actuator, tripod.ActuatedArm2.ServoArm.actuator])
            GoalController(goalNode[0],[tripod.RigidifiedStructure.RigidParts.actuators,tripod.ActuatedArm0.ServoMotor.Angle.actuator, tripod.ActuatedArm1.ServoMotor.Angle.actuator, tripod.ActuatedArm2.ServoMotor.Angle.actuator])

