    def tripod_transverse(name="Tripod_HO",directions_spiral=None,translation=None,rotation=None,elasticitySymmetry='transverseIsotropic'):
        if inverse: goalNode = (Inverse(scene,rotation,translation),use_orientation)
        else: goalNode = None

        transverse_anisotropy_coef = [[4,1.0,0,0]]*nbr_tretra
        anisotropyDirections = [[0,1,0]]*nbr_tretra

        #######################################################################################################################################################
        # TRANSVERSE ONLY 

